import React, { useEffect, useState } from "react";
import { View, Pressable, Image, Platform  } from "react-native";
import { LinearGradient } from "expo-linear-gradient";
import { fontPixel, heightPixel, widthPixel } from "../../lib/style/adjust";
import { useStyles } from "../../lib/style/useStyle";
import { useSafeAreaInsets } from "react-native-safe-area-context";
import PixelImage from "../../Components/common/PixelImage";
import FocusAwareStatusBar from "../../Components/common/FocusAwareStatusBar";
import auth from "../../lib/api/auth";
import AsyncStorage from "@react-native-async-storage/async-storage";
import { Icon ,Text, List } from "react-native-paper";
import { ScrollView } from "react-native-gesture-handler";



const Profile = ({ navigation }) => {
    const theme = {
    
        roundness: 2,
        version: 3,
        colors: {
        
          primary: '#20496c',
          
        },
        color:'#20946c'
      };
    
    const signMeOut = async () => {
        await AsyncStorage.removeItem('userId');
        await AsyncStorage.removeItem('userRole');
        await AsyncStorage.removeItem('role');
        await AsyncStorage.removeItem('userToken');
        navigation.navigate('Auth');
    }


    const commonStyle = useStyles();
    const insets = useSafeAreaInsets();
    const [userData, setUserData] = useState([]);
    const [education, setEducation] = useState([]);
    const getUserData = async () => {
        let _id = await AsyncStorage.getItem("userId");
        let id = JSON.parse(_id);
        const data = {
            id: id,
        };
        console.log(data);
        const response = await auth.post("user/userData", data);
        // console.log(response.data);
        setUserData(response.data);
        setEducation(userData.education);
        console.log(education);
    };

    useEffect(() => {
        getUserData();
    }, []);

    const profileData = [
        {
            id: 1,
            title: "Introduction/Bio",
        },
        {
            id: 2,
            title: "Practice Area",
        },
        {
            id: 3,
            title: "Education",
        },
        {
            id: 4,
            title: "WorkExperience",
        },
    ];

    return (
        <View
            style={{
                paddingTop: 0,
                // paddingBottom: insets.bottom,
                flex: 1,
                backgroundColor: "#FFFFFF",
            }}
        >
            <FocusAwareStatusBar
                translucent
                backgroundColor="transparent"
                barStyle="light-content"
            />
            <View
                style={{
                    ...Platform.select({
                        ios: {
                            shadowColor: "rgba(0, 0, 0, 0.1)",
                            shadowOffset: {
                                width: 0,
                                height: 10,
                            },
                            shadowOpacity: 0.8,
                            shadowRadius: 2,
                        },
                        android: {
                            elevation: 30,
                        },
                    }),
                }}
            >
                <LinearGradient
                    style={{
                        width: "100%",
                        height: '100%',
                        
                    }}
                    colors={["#fff", "#fff"]}
                    start={{ x: 0, y: 1 }}
                >

                    <View
                        style={{
                            flex:1,
                            flexDirection:'row',
                            margin: 25,
                            backgroundColor: "rgba(4, 80, 122, 0.2)",
                            borderRadius: widthPixel(40),
                            
                            
                        }}
                    >
                        <Image
                            style={{ width: 100, height: 100, borderRadius: 50 , resizeMode: "contain", marginLeft:20, marginTop:30 }}
                            source={{ uri: userData?.profileImage }}
                        />
                        <Text
                                style={{
                                    color: "#29406C",
                                    marginTop:60,
                                    marginLeft:30,
                                    fontSize: fontPixel(26),
                                    fontWeight: "300",
                                    textTransform: "uppercase",
                                }}
                            >
                                {userData?.firstName}

                            </Text>
                                </View>
                        <View style={{
                            flex:2,
                            top: '0%',
                            left:'10%',
                            display: 'flex', flexDirection: 'column',
                            justifyContent: 'space-between', width: '100%'
                        }}>
                        <ScrollView style={{
                            height:400
                        }}>
                           
                           
                            <View >
                            <List.Item
                            
                                title="Email"
                                titleStyle={{color: '#29406c'}}
                                description= {userData?.email}
                                descriptionStyle={{color: '#29406c'}}

                                left={props => <List.Icon style={{color:'#29406C'}}  color="#29406C"  icon="email" />}
                                
                                />
                                <List.Item
                            
                            title="Practice Area :"
                            titleStyle={{color: '#29406c'}}
                            description= {userData?.practiceArea}
                            descriptionStyle={{color: '#29406c'}}

                            left={props => <List.Icon style={{color:'#29406C'}}  color="#29406C"  icon="gavel" />}
                            
                            />
                                <List.Item
                            
                            title="Consultation Charges:"
                            titleStyle={{color: '#29406c'}}
                            description= {userData?.consultationFee} Rs
                            descriptionStyle={{color: '#29406c'}}

                            left={props => <List.Icon style={{color:'#29406C'}}  color="#29406C"  icon="currency-rupee" />}
                            
                            />
                            <List.Item
                            
                            title="Specialization:"
                            titleStyle={{color: '#29406c'}}
                            description= {userData?.areaOfSpecialization}
                            descriptionStyle={{color: '#29406c'}}

                            left={props => <List.Icon style={{color:'#29406C'}}  color="#29406C"  icon="briefcase" />}
                            
                            />
                            <List.Item
                            
                            title="Bio:"
                            titleStyle={{color: '#29406c'}}
                            description=   {userData?.bio}
                            descriptionStyle={{color: '#29406c'}}

                            left={props => <List.Icon style={{color:'#29406C'}}  color="#29406C"  icon="card-account-details" />}
                            
                            />
                                </View>
                            <Pressable style={{
                            backgroundColor: '#29406C',
                            width: '50%',
                            borderRadius: 36,
                            marginTop:50
                        }}
                            onPress={
                                signMeOut
                            }>
                            <Text style={{
                                color: 'white',
                                padding: 10,
                                textAlign: 'center'
                            }}>SignOut</Text>
                        </Pressable>
                        </ScrollView>
                        </View>
                </LinearGradient>
            </View>



        </View>
    );
};

export default Profile;
